[{"location":"","page":"Home","title":"Home","text":"CurrentModule = AIS","category":"page"},{"location":"#AIS","page":"Home","title":"AIS","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for AIS.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [AIS]","category":"page"},{"location":"#AIS.Geometry","page":"Home","title":"AIS.Geometry","text":"Geometry is a coordinate on a geographic coordinate system.\n\nstruct Geometry\n    longitude::Real\n    latitude::Real\nend\n\n\n\n\n\n","category":"type"},{"location":"#AIS.Planar","page":"Home","title":"AIS.Planar","text":"Planar is a coordinate on a planar projection of Geometry with ContactPoint as a point of contanct. In a Planar Coordinate System, the units are meters.\n\nstruct Planar\n    x::Real\n    y::Real\nend\n\n\n\n\n\n","category":"type"},{"location":"#AIS.Planar-Tuple{AIS.Geometry}","page":"Home","title":"AIS.Planar","text":"Planar(G::Geometry;ContactPoint::Geometry=DefaultRefPoint)\n\nReturn a Planar coordinate Planar(x,y) on a planar projection of G with ContactPoint as a point of contact. By default, TokyoBayRefPoint is a DefaultRefPoint.\n\n\n\n\n\n","category":"method"},{"location":"#AIS.dist-Tuple{AIS.Planar, AIS.Planar}","page":"Home","title":"AIS.dist","text":"dist(A::Planar,B::Planar)\n\nGet the Euclid distance of A and B. \n\ndist(A::Planar) = dist(A,Planar(0.0,0.0))\n\n\n\n\n\n","category":"method"},{"location":"#AIS.rotate-Tuple{AIS.Planar, Real}","page":"Home","title":"AIS.rotate","text":"rotate(A::Planar,θ::Real)\n\nGet a Planar rotated A θ counterclockwise\n\n\n\n\n\n","category":"method"},{"location":"#Base.:+-Tuple{AIS.Planar, AIS.Planar}","page":"Home","title":"Base.:+","text":"Base.:+(A::Planar,B::Planar)\n\nGet a composite vector of positional vectors A and B.\n\n\n\n\n\n","category":"method"},{"location":"#Base.:--Tuple{AIS.Planar, AIS.Planar}","page":"Home","title":"Base.:-","text":"Base.:-(A::Planar,B::Planar)\n\nGet a composite vector of positional vectors A and -B.\n\n\n\n\n\n","category":"method"},{"location":"#Base.cos-Tuple{AIS.Planar, AIS.Planar}","page":"Home","title":"Base.cos","text":"Base.cos(A::Planar,B::Planar)\n\nGet a cosine of the angle between vectors A and B.\n\n\n\n\n\n","category":"method"},{"location":"#Base.minimum-Tuple{Vector{AIS.Planar}}","page":"Home","title":"Base.minimum","text":"Base.minimum(A::Vector{Planar};dist=dist)\nBase.maximum(A::Vector{Planar};dist=dist)\n\nReturn the element of A with the minimum (maximum) distance from the origin Planar(0.0,0.0). By default, the distance is Euclid distance.\n\n\n\n\n\n","category":"method"}]
